import React from 'react'
import NavBar from './NavBar'
import { useLoaderData } from 'react-router'

const Home = () => {
  const data = useLoaderData();
  return (
    <>
		<NavBar />
    <div>
      {
        data.map(i => <div>{i.name}</div>)
      }
    </div>
    </>
  )
}

export default Home;
